import axios from 'axios';

export function createPNUser(data) {
    console.log(data,"data in createUser")
    axios.post('https://notifier-staging.tokopedia.com/imt/api/v1/user/add', data)
        .then(function (response) {
            console.log('response is abc' ,response)
        })
        .catch(function (error) {
            console.log('error is' + error)
        });
}
